    def __make_request(self, end_point, payload):
        key = str(payload)
        response = self.flight_aware_cache.get(key) if self.cache_enabled else None
        if (response == None):
            print("Cache Miss!")
            response = requests.get(self.FXML_URL + end_point, params=payload, auth=self.authentication_info)

            if self.cache_enabled:
                self.flight_aware_cache.add(key, response)
        else:
            print("Cache Hit!")

        if response.status_code == 200:
            decodedResponse = response.json()
            return decodedResponse
        else:
            print("Unable to retrieve flight aware data", response.text)
            return RuntimeError("Unable to retrieve flight aware data")

    def find_flight_cancellation_statistics(self, time_period, type_matching, ident_filter):
        '''
        find_flight_cancellation_statistics fetches statistics about how many flights have been cancelled on the
        specified day, and aggregated by the specified breakdown criteria. Currently supported criteria include the
        operating airline, the origin airport, or the destination airport.

        :param time_period: (must be 'yesterday', 'today', 'tomorrow', 'plus2days', 'twoDaysAgo', 'minus2plus12hrs', 'next36hrs', 'week')
        :param type_matching: (must be 'airline', 'origin', or 'destination')
        :param ident_filter: this argument can be blank/unspecified to request that all results are returned. Otherwise,
            when type_matching is 'airline', this argument can be the specific airline you are interested in.
            When type_matching is 'origin' or 'destination', this argument can be the specific airport you are interested in.
        :return: CancellationSummaryStruct
        '''

        if (self.is_production):
            payload = {'time_period': time_period, 'type_matching': type_matching, 'ident_filter': ident_filter}
            return self.__make_request('FlightCancellationStatistics', payload)
        else:
            return self.stubbed_find_flight_cancellation_statistics_response

